import React from 'react';
import { directive } from '@babel/types';
class Content extends React.Component
{
    render()
    {
        return(
            <div>
                <section>
                    <nav id="navleft">
                        <ul>
                            <a  href="#"><li>Home</li></a>
                            <a  href="#"><li>Content</li></a>
                            <a  href="#"><li>About</li></a>
                            <a  href="#"><li>Etc</li></a>
                            <a  href="#"><li>...</li></a>
                        </ul>
                    </nav>
                    <article id="conright">
                        This content will be updated soon...
                    </article>
                </section>
            </div>
        );
    }
}
export default Content;
